import ReactDOM from "react-dom/client";

const container = document.getElementById("root");
const root = ReactDOM.createRoot(container);

function changeColor() {
  let d = new Date();
  let hour = d.getHours()

  if (hour >= 5 && hour <= 12) {
    return "blue";
  } else if (hour > 12 && hour < 6) {
    return "red";
  } else {
    return "green";
  }
}

